Hadiluwih iku désa ing Kacamatan Sumberlawang, Sragèn. Désa Hadiluwih, sawijining désa ing arah paling kidul kanggo wewengkon Kacamatan Sumberlawang. Wewengkon pesawahan tadhah udan kang kabèh dumunung ing dataran datar kanthi jinis tanah ireng (grumusol). Luwih saka 80% sing ndunungi urip saka tetanèn. Kasil sing paling dominan tuwuhan pangan: pari, jagung, kacang tanah.
Désa Hadiluwih dumadi saka dhusun: Kedungdowo, Bibis, Pandanan, Bojong, Jetak lan Sumber rejo. Papréntahan désa mau kalurahan/Désa Hadiluwih. Ana 5 kebayanan: Kedungdowo I, Kedungdowo II, Bojong, Jetak-Sumberrejo, Pandanan lan Bibis.
Agama Islam dominan ing tlatah Hadiluwih, punjul 90% penduduke nganut agama Islam. Pendidikan warga désa Hadiluwih: ora lulus SD - nganti master. Ana: 4 TK, 2 SD, 1 MI.
Wektu iki lurah/ kepala désa ing Hadiluwih: Ibu Kartini.
